text12689.addInnerText('<div id=\"text12689\"><a id=\"text12689anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse; border-spacing:0\" >\n<tr style=\"vertical-align:top\"  >\n<td style=\"width:270px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text12689Font1\"  >Grupos</span ></p >\n</td >\n<td style=\"width:336px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text12689Font1\"  >Detalhamento</span ></p >\n</td >\n<td style=\"width:324px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:center;\" >\n<span class=\"text12689Font1\"  >Benefícios</span ></p >\n</td >\n</tr >\n<tr style=\"vertical-align:top\"  >\n<td style=\"width:270px;height:318px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text12689Font3\"  >Grupo das carnes e ovos</span ></p >\n</td >\n<td style=\"width:336px;height:318px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text12689Font3\"  >Este grupo inclui carnes de gado, porco, cabrito e cordeiro (as chamadas carnes vermelhas), carnes de aves e de pescados e ovos de galinha e de outras aves. Possuem também em comum o fato de serem ricos em proteína e em vitaminas e minerais.</span ></p >\n</td >\n<td style=\"width:324px;height:318px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:justify;\" >\n<span class=\"text12689Font3\"  >Como as carnes vermelhas e de aves, os peixes são ricos em proteína de alta qualidade e em muitas vitaminas e minerais. Pelo menor conteúdo de gorduras e, em particular, pela alta proporção de gorduras saudáveis (gorduras insaturadas), os peixes, tanto quanto os legumes e verduras, são excelentes substitutos para as carnes vermelhas. Como as carnes e os peixes, os ovos são ricos em proteínas de alta qualidade, em minerais e em vitaminas, especialmente as do complexo B.</span ></p >\n</td >\n</tr >\n<tr style=\"vertical-align:top\"  >\n<td style=\"width:270px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<span style=\"line-height:2px;\">&nbsp;</span >\n</td >\n<td style=\"width:336px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<span style=\"line-height:2px;\">&nbsp;</span >\n</td >\n<td style=\"width:324px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<span style=\"line-height:2px;\">&nbsp;</span >\n</td >\n</tr >\n<tr style=\"vertical-align:top\"  >\n<td style=\"width:270px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<span style=\"line-height:2px;\">&nbsp;</span >\n</td >\n<td style=\"width:336px;height:24px; padding-left:4px;padding-right:4px;padding-bottom:0px;padding-top:0px;vertical-align:top;\" >\n<span style=\"line-height:2px;\">&nbsp;</span >
